//Objeto No metales

function ElementoNoMetal(nuevoNombreElemento, sq) {

    this.nuevoNombreElemento = nuevoNombreElemento.trim(); //Nuevo nombre dele lmento, con el prefijo uro añadido

    this.sq = sq.trim();   //Simbolo quimico
}

export default ElementoNoMetal;
